import './App.css';

function App() {
  const winningSets = [
    '036', '147', '358', '012', '345', '678', '048', '246'
  ]
  const squares = new Array(9).fill('.');

  return (
    <div className="App">
      <h1>Tic Tac Toe GAME</h1>
      <div className='game'></div>
      {squares.map((s, i) => { <button>{s}</button> })}
    </div>
  );
}

export default App;
